webpackJsonp([0x80b6bd3f9185],{405:function(s,o){s.exports={data:{site:{siteMetadata:{title:"MAC0215 Blog",author:"Victor Hugo M. Pinto"}},markdownRemark:{id:"/Users/victorhugo/BCC/mac0215-blog/src/pages/dados-originais/index.md absPath of file >>> MarkdownRemark",html:"<p>Durante esta semana coletei os dados originais obtidos das edições anteriores do HackathonUSP:</p>\n<ul>\n<li>2016.1</li>\n<li>2016.2</li>\n<li>2017.1</li>\n<li>2017.2</li>\n<li>2018.1</li>\n</ul>\n<p>As planilhas obtidas dos formulários de inscrição foram salvas em um repositório Git <strong>privado</strong> (devido aos dados pessoais dos inscritos), hospedado no GitLab. Com isso, pretendo fazer as alterações necessárias para as devidas análises enquanto mantendo um versionamento dos dados, tornando o processo reprodutível futuramente.</p>\n<p>Dentre as planilhas coletadas, temos planilhas com dados de todos os incritos, planilhas com os dados dos incritos selecionados, planilhas com inscritos colocados em “lista de espera” e planilhas que controlaram a presença dos selecionados nos eventos. Porém, as disponibilidades de tais planilhas está variada, ou seja, nem todas as edições possuem o mesmo número de planilhas com todas as informações. Isso deverá ser levado em conta nas análises.</p>\n<p><strong>Horas</strong>: 1 hora</p>",frontmatter:{title:"Dados originais",date:"September 07, 2018"}}},pathContext:{slug:"/dados-originais/",previous:{fields:{slug:"/coleta-de-dados/"},frontmatter:{title:"Coleta de dados"}},next:{fields:{slug:"/inferência-de-gênero/"},frontmatter:{title:"Inferência de Gênero"}}}}}});
